import tensorflow as tf
from tensorflow.keras.datasets import fashion_mnist
from tensorflow.keras.layers import Conv2D, Dropout, MaxPooling2D, Flatten, Dense
# Helper libraries
import numpy as np
import matplotlib.pyplot as plt

"""### La data que se va a ocupar se trata de imagenes de distintos tipos de ropa y nuetra red tendra que identificar a que prenda o accesorio corresponde la imagen"""

(train_images, train_labels), (test_images, test_labels) = fashion_mnist.load_data()

train_images.shape # Son 60,000 imagenes que de 28 x 28 pixeles

plt.imshow(train_images[99])

"""# Limpieza de datos"""

train_images = train_images.astype('float32') / 255 # Se divide entre 255 porque el valor de un pixel es de 1 a 255 y al dividirlo tendriamos valores de 0 a 1 , y asi trabaje mejor la red neuronal
test_images = test_images.astype('float32') / 255

train_images = train_images.reshape(train_images.shape[0], 28, 28, 1) # El 1 al final es el canal del color
test_images = test_images.reshape(test_images.shape[0], 28, 28, 1)

train_labels[0] # El valor en la posicion 0 es clasificado como 9

train_labels = tf.keras.utils.to_categorical(train_labels, 10) # Es 10 porque solo tenemos 10 posibles valores de salida
test_labels = tf.keras.utils.to_categorical(test_labels, 10)

train_labels[0] # Lo que hizo la funcion to_categorical fue converstir el valor escalar a un arreglo binario en donde habra un 1 en la poscion que corrsponde al valor escalar

"""# Creacion del modelo"""



"""1er capa Convolucion

En esta capa se da el proceso de convolucion que no es mas que una operacion matricial entre el kernel(matriz de pesos) y la imagen con el proposito de detectar patrones en los datos como los bordes , texturas o formas

Hiperparametros de la capa de convolucion

- filters : te dice la cantidad de kernels
 - kernel_size : te dice el tamano de la matriz
 - padding : Es un margen que se le agrega a ala imagen para que al  momento de realizar la operacion de convolucion la imagen resultante no resduzca su tamano
 - stride : Es el tamano del paso en cada convolucion.Entre mas grande sea el paso menor sera la imagen resultante


 2da capa Pooling

 Esta capa se encarga de disminuir la complejidad de la red neuronal para uqe sea mas facil de procesar y gastar menos recursos de computo.Se trata de otra matriz(kernel) que realiza el recorrido en la mtriz que fue la salida de la operacion de convolucion y obtiene el maximo o el promedio que mejor representa al kernel. Se va a reducir el ancho y largo de la imagen pero no las propiedades.Sirve para eliminar el ruido de los demas pixeles

 ![image.png](data:image/png;base64,)
"""

model = tf.keras.Sequential()
model.add(Conv2D(filters=64 , kernel_size=2,padding='same',activation='relu',input_shape=(28,28,1)))
model.add(MaxPooling2D(pool_size=2))
model.add(Dropout(0.3))
model.add(Conv2D(filters=32,kernel_size=2 , padding = 'same', activation = 'relu'))
model.add(MaxPooling2D(pool_size=2))
model.add(Dropout(0.3))
model.add(Flatten())
model.add(Dense(256, activation='relu'))
model.add(Dropout(0.5))
model.add(Dense(10, activation='softmax'))
# Take a look at the model summary
model.summary()

"""## Compilando Red Neuronal"""

model.compile(loss='categorical_crossentropy',
             optimizer='rmsprop',
             metrics=['accuracy'])

"""## Entrenando la Red"""

model.fit(train_images,train_labels, batch_size=64,epochs=10)

"""## Analisis de Resultados"""

score = model.evaluate(test_images, test_labels, verbose=0)

score